async () => {

		if(selectEntityProofofIdentity.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('POI');	
			QueryIndPartnerKycPOI.run();
			await	QueryInsertKYCIndPartnership.run({ 
				docType: SelectPOI.selectedOptionValue,
				docPathFilename: selectEntityProofofIdentity.files[0].name
			});
		}

		if(selectEntityProofofAddress.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('POA');	
			await	QueryInsertKYCIndPartnership.run({
				docType: SelectPOA.selectedOptionValue, 
				docPathFilename: selectEntityProofofAddress.files[0].name
			});
			QueryIndPartnerKycPOA.run();
		}

		if(selectEntityPAN.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('PAN');	
			await QueryInsertKYCIndPartnership.run({
				docType:'PAN',
				docPathFilename: selectEntityPAN.files[0].name
			});
			QueryIndPartnerKYCPAN.run();
		}

		if(selectEntityCnclChq.files.length === 1) {
		 	await JSObjectKYCIndPartnership.deleteIfFileExist('CC');	
			await QueryInsertKYCIndPartnership.run({ 
				docType: 'Cancelled Cheque',
				docPathFilename: selectEntityCnclChq.files[0].name
			});
			QueryIndPartnerKYCancelChq.run();
		}

		if(selectEntityImpExpCert.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('IEC');	
			await QueryInsertKYCIndPartnership.run({ 
				docType: 'Import Export Certificate',
				docPathFilename: selectEntityImpExpCert.files[0].name
			});
			QueryIndPartnerKYCImpExpCert.run();
		}

		if(selectEntityPtnerShipDeed.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('PD');	
			await QueryInsertKYCIndPartnership.run({ 
				docType: 'PartnerShip Deed',
				docPathFilename: selectEntityPtnerShipDeed.files[0].name
			});
			QueryIndPartnerKYCPtnrshipDeed.run();
		}

		if(selectEntityPtnerShipLetter.files.length === 1) {
			await JSObjectKYCIndPartnership.deleteIfFileExist('PL');	
			await QueryInsertKYCIndPartnership.run({ 
				docType: 'Partnership Letter',
				docPathFilename: selectEntityPtnerShipLetter.files[0].name
			});
			QueryIndPartnerKYCPtnrshipLtr.run();
		}

		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

